import React from 'react'
import Menu from './Menu'

const Webinar = () => {
  return (
    <div>
        <Menu/>

        <section className='section-1'>
        <img src='img/webinar/webinar-banner.png' alt='Webinar Banner'/>
        </section>
    </div>
  )
}

export default Webinar
